// import logo from './logo.svg';
import './App.css';
import HomePage from './Components/HomePage'
import Projects from './Components/Projects'
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import Workshops from './Components/Workshops'
import Navbar  from './Components/Navbar'
import Landing from './Components/Landing'
import Project from './Components/Project'
import Events from './Components/Events'
import MemberCard from './Components/MemberCard';
import Carousel from './Components/Carousel';
import AboutUs from './Components/AboutUs';
import FAQ from './Components/FAQ';
import FaqDisplay from './Components/FaqDisplay';
import MemberDisplay from './Components/MemberDisplay';
import MemberAll from './Components/MemberDisplay';
import Loader from './Components/MemberDisplay';


const letters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";

let interval = null;

document.querySelector("h1").onmouseover = event => {  
  let iteration = 0;
  
  clearInterval(interval);
  
  interval = setInterval(() => {
    event.target.innerText = event.target.innerText
      .split("")
      .map((letter, index) => {
        if(index < iteration) {
          return event.target.dataset.value[index];
        }
      
        return letters[Math.floor(Math.random() * 26)]
      })
      .join("");
    
    if(iteration >= event.target.dataset.value.length){ 
      clearInterval(interval);
    }
    
    iteration += 1 / 3;
  }, 30);
}



function App() {

  const letters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";

let interval = null;

const abc= document.onclick= onclick  => {  
  let iteration = 0;
  
  clearInterval(interval);
  
  interval = setInterval(() => {
    onclick.target.innerText = onclick.target.innerText
      .split("")
      .map((letter, index) => {
        if(index < iteration) {
          return onclick.target.dataset.value[index];
        }
      
        return letters[Math.floor(Math.random() * 26)]
      })
      .join("");
    
    if(iteration >= onclick.target.dataset.value.length){ 
      clearInterval(interval);
    }
    
    iteration += 1 / 3;
  }, 30);
} 

  return (

    <Router>
      <div className="App">
        
        <Navbar abc={abc} />
        <Switch>
       
        <Route path="/" exact component={Project} />
         
          <Route path="/Events" component={Events} />
         
          <Route path="/Workshops" component={Workshops} />
          <Route path="/Gallery" component={Carousel} />
          <Route path="/AboutUs" component={AboutUs} />
          <Route path="/OurTeam" component={MemberDisplay} />
          <Route path="/FAQ" component={FaqDisplay} />
          
          {/* <Route path="/Workshops" component={Workshops} /> */}


        </Switch>
      </div>


    </Router>
    // <div>
    //   <MemberCard />
    // </div>
    
  );
}

export default App;
